import React from 'react';
import { Link } from 'react-router-dom';
import './WorkTitle.css';

function WorkTitle({
    h1_title, h2_subtitle, info_1, info_2, info_3
}) { 
    return (
        <>
        <div className="header container">
            <span className="h1_title">{h1_title}</span> <br />
            <span className="h2_subtitle">{h2_subtitle}</span>
        </div>

        <div className="header_img">
            <img class="img_cover" src={"./images/joul/cover.jpg"} />
        </div>

        <div className="header_info">
            <div className="info_1">
                <span className="h3_title">PROJECT DETAILS</span> <br /> <br />
                <span className="p_text p_info">{info_1}</span>
            </div>
            <div className="info_2">
                <span className="h3_title">MY ROLE</span> <br />
                <span className="p_text">{info_2}</span>
            </div>
            <div className="info_3">
                <span className="h3_title">TOOLS USED</span> <br />
                <span className="p_text">{info_3}</span>
            </div>
        </div>
        </>
    );
}

export default WorkTitle;
